                                        <option value={v} name="alternative">Альтернатив: {v}</option>
                                    ))}

                                </select>

                                <label>Кол-во альтернатив</label>
                            </div>


                        </div>
                        <div className="card-action">
                            <button
                                className='btn auth-btn-custom'
                                onClick={inputDataHandler}

                            >Далее</button>
